import { StudentTable } from "../components/StudentTable";

export function HomePage() {
  return (
    <div className="container">
      <h1 className="is-size-1">Students</h1>
      <StudentTable></StudentTable>
      <StudentForm preloadedData={null} />
    </div>
  );
}
